using System;
using System.Collections.Generic;
using System.Collections;
using System.Linq;
using System.Text;
using System.IO;
using DocumentFormat.OpenXml.Packaging;
using Ap = DocumentFormat.OpenXml.ExtendedProperties;
using Vt = DocumentFormat.OpenXml.VariantTypes;
using DocumentFormat.OpenXml;
using DocumentFormat.OpenXml.Spreadsheet;
using A = DocumentFormat.OpenXml.Drawing;

namespace SimpleOX.Excel {

	public class SimpleSpreedsheetPrinterSettingsPart {

		public SimpleSpreedsheetPrinterSettingsPart() {
		}

		public void Generate( SpreadsheetPrinterSettingsPart spreadsheetPrinterSettingsPart ) {
			System.IO.Stream data = GetBinaryDataStream( spreadsheetPrinterSettingsPart1Data );
			spreadsheetPrinterSettingsPart.FeedData( data );
			data.Close();
		}

		#region Binary Data
		private string spreadsheetPrinterSettingsPart1Data = "";

		private System.IO.Stream GetBinaryDataStream( string base64String ) {
			return new System.IO.MemoryStream( System.Convert.FromBase64String( base64String ) );
		}

		#endregion
	}
}
